import React from 'react'
import Message from './Message'

const ChatPeriod = ({ date, messages }) => (
  <div>
    <p className="chat-period-line">
      <span>{date}</span>
    </p>
    <div>{
      messages.map((message, index) =>
        <Message key={index} {...message} />
      )}
    </div>
  </div>
)

export default ChatPeriod
